import React from 'react';
import ReactDOM from 'react-dom';

let name = "Aashish";

const imageLink = "https://picsum.photos/200/300";

ReactDOM.render(
  <>
    <h2>My name is {name}. </h2>

    <img src = {imageLink} alt = "Random Image from google"/>
  </>,
  document.getElementById('root')
);
